import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header.js";
import Card from "./components/Card.js";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className={"App"} style={{ maxWidth: 960, margin: "0 auto" }}>
      <Header />
      <main>
        <div className={"flex flex-col items-start gap-4 my-40"}>
          <div className={"flex flex-col items-start gap-1"}>
            <h4 className={"text-1xl font-semibold text-green-500"}>
              UX Designer & Developer
            </h4>
            <h1 className={"text-5xl font-bold text-gray-600"}>
              Chris Northcutt
            </h1>
          </div>
          <p className={"text-base font-semibold text-gray-800"}>
            I’m a product designer, podcaster, and writer, living in San
            Francisco. I’m currently building native mobile apps at GitHub.
          </p>
        </div>
        <Card title={"MyMedicalLocker"} link={"mymedicallocker"} />
        <Card
          title={"OfficeEMR Mobile"}
          gradient={
            "linear-gradient(104.77deg, #CA9C42 -7.17%, #FBC255 96.95%)"
          }
          link={"anywherecare"}
        />
        <Card
          title={"AnywhereCare"}
          gradient={
            "linear-gradient(104.77deg, #8BB3C5 -7.17%, #4CD9D1 96.95%)"
          }
          link={"anywherecare"}
        />
      </main>
    </div>
  );
}

export default App;
